webpackJsonp([0xbe3124d9ce0a],{5331:function(e,t){e.exports={data:{post:{html:"<p>There's a first time for everything. Christopher's at a substitute 'Tagesmutter' for 3 weeks, as Heide is on vacation. This afternoon, for the first time at day care, he didn't want to come home. He had to show off the tricycle (that he can't quite pedal yet) and the mini-slide (that he can climb and slide down by himself). </p>\n<p>Retraction: the hotel linked to yesterday isn't really that bad, it's merely ugly, inside and out. But it's the biggest hotel in Munich, so when Mama has to attend big events in Munich, she usually gets put there.(<i>Later</i> Mama tells me that they've remodelled since I was there, so it's not even ugly on the inside anymore. Just from the outside.)</p>",fields:{title:"Don't Make Me Go",date:"05 Sep 2001",url:"https://papascott.de/2001-09-05-dont-make-me-go/"}}},pathContext:{slug:"/2001-09-05-dont-make-me-go/",prev:{fields:{title:"No Broadband",date:"04 Sep 2001",slug:"/2001-09-04-no-broadband/"}},next:{fields:{title:"18 Years Ago",date:"06 Sep 2001",slug:"/2001-09-06-18-years-ago/"}}}}}});
